import React from 'react';
import logo from './logo.svg';
import style from './index.css';

class App extends React.Component {
  state = {
    country: 'Russia!'
  }

  render() {
    return (
      <div>
        <div>
          <h1>{this.state.country}</h1>
        </div>
        <div>
          <img 
          src='https://cdn.countryflags.com/thumbs/russia/flag-round-250.png' alt='' style={style.country-flag}/>
        </div>
      </div>
    )
  }

}

export default App;
